"use strict";function draw(a){a.width=WIDTH,a.height=HEIGHT;var b=a.getContext("2d");b.shadowColor="rgba(0, 0, 0, 0.3)",b.shadowBlur=20,b.shadowOffsetX=10,b.shadowOffsetY=10;for(var c=0;c<droplets;c++)blueSquares.push(getRandomNum(0,100));return b}function getRandomNum(a,b){return Math.round(Math.random()*(b-a+1))+a}function moveCubes(a){buildingsY++,buildingsY>2*WIDTH&&(buildingsY=-WIDTH);for(var b=0;b<droplets;b++)blueSquares[b]++,blueSquares[b]>HEIGHT&&(blueSquares[b]=0)}function update(a){a.clearRect(0,0,WIDTH,HEIGHT),moveCubes(a),a.fillStyle="#ddd";var b=40,c=20;a.fillRect(buildingsY+90,HEIGHT-c,20,c),a.fillRect(buildingsY+50,HEIGHT-c,20,c),a.fillRect(buildingsY,HEIGHT-b,20,b),a.fillRect(buildingsY-40,HEIGHT-b,20,b),a.fillRect(buildingsY-80,HEIGHT-c,20,c),a.fillRect(buildingsY-150,HEIGHT-b,20,b),a.fillRect(buildingsY-200,HEIGHT-c,20,c),a.fillStyle="rgba(0, 0, 50, 0.5)";for(var d=0,e=0;e<droplets;e++)a.beginPath(),a.fillRect(d,e+blueSquares[e],rain_size,rain_size),d+=rain_size+10}function doesElementExist(a){return"undefined"!=typeof a&&null!=a}console.log("Loaded front end Javascript");var WIDTH=200,HEIGHT=200,buildingsY=0,rain_size=20,blueSquares=[],droplets=WIDTH/(rain_size+5);window.onload=function(){var a=document.getElementById("png-example");if(doesElementExist(a)){var b=draw(a);setInterval(function(){update(b)},20)}};